import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faEllipsisH,
  faPause,
  faPlay,
  faStepBackward,
  faStepForward
} from "@fortawesome/free-solid-svg-icons";

const Menu = () => {
  return (
    <>
      <div
        style={{
          textAlign: "center",
          fontSize: "72px",
          position: "absolute",
          left: "50%",
          transform: "translateX(-50%)",
          bottom: "90vh"
        }}
      >
        <FontAwesomeIcon icon={faEllipsisH} />
      </div>
      <div
        style={{
          height: "90vh",
          width: "100vw",
          backgroundColor: "green",
          position: "absolute",
          bottom: 0
        }}
      >
        <div
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            fontSize: "96px",
            width: "90vw",
            padding: "2vh 5vw"
          }}
        >
          <div style={{ fontSize: "48px" }}>
            <FontAwesomeIcon icon={faStepBackward} />
          </div>
          <div style={{ fontSize: "96px", margin: "0 96px" }}>
            <FontAwesomeIcon icon={faPlay} />
          </div>
          <div style={{ fontSize: "48px" }}>
            <FontAwesomeIcon icon={faStepForward} />
          </div>
        </div>
      </div>
    </>
  );
};

export default Menu;
